import React from 'react';
import './emptyavatar.css'

const EmptyAvatar = ({nickname}) => {
  return (
    <div className="avatar_empty">
      <strong className="text">{nickname.split(' ').map(word => word.substr(0, 1).toUpperCase()).join(' ')}</strong>
    </div>
  );
}

export default EmptyAvatar;
